import { BrowserRouter, Routes, Route } from 'react-router-dom';
import DefaultLayout from "~/Layout/DefaultLayout";
import Home from "~/pages/Home";

function Client() {
    return (
        <Routes>
            <Route path="/" element={
              <DefaultLayout>
                <Home />
              </DefaultLayout>
            } />
            <Route path="/product" element={
              <DefaultLayout>
                <p>Sản phẩm</p>
              </DefaultLayout>
            } />
        </Routes>
    );
}

export default Client;
